import React from "react";
import Heading from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function createNote(note) {
    return (
        <Note
        key = {note.id}
        title = {note.title}
        content = {note.content}
         />
    );
}

function App(){
    return (<div>
    <Heading  />
    {notes.map(createNote)}
    <Footer  />
    </div>);
}

export default App;
